Herb oil marinade. This quick recipe will show you my favorite marinade I use for any protein, potatoes, vegetables and more. It's very versatile and easy to make.
*
I use spinach, thyme, rosemary, sage, basil, parsley, garlic and shallots. If you don't have a shallot you can substitute red onions. This batch is about one cup or more of olive oil. It is easier to add oil to get the right consistency vs adding too much at first.
